import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Acceuil() {
  return (
    <>
      <HeroSection />
      <div><h1 className='chambres'>À bientôt chez nous !</h1></div>
      <Cards />
      <Footer />
    </>
  );
}

export default Acceuil;
